(3401, 253, NULL, '0', 'Transit.inactifs', NULL, NULL, NULL, NULL, NULL, 1, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0, NULL, 'Qu\'est ce ?\n\" - Les Amis du Peuple est une association privÃ©e et indÃ©pendante, qui a vocation Ã  rÃ©unir tous les partisans de l\'Ordre et de la renaissance de la civilisation. On peut dire en partie qu\'elle fonctionne sous forme de rÃ©seau, chaque membre ayant le devoir d\'entraide et de fraternitÃ© envers les autres. Bien sÃ»r, ce n\'est pas un groupe fermÃ© : tout le monde peut y entrer, ou le contacter pour n\'importe quelle raison !\n\nBut.\n- Le but des Amis du peuple est d\'abord et avant tout de jouer le rÃ´le de maillon entre l\'Ordre Citoyen et les citoyens eux-mÃªmes, en tant qu\'individus. Il se doit d\'Ãªtre le corps intermÃ©diaire, celui qui d\'un cÃ´tÃ© fait connaÃ®tre le message et l\'oeuvre de l\'Ordre Citoyen au peuple et qui de l\'autre fait remonter les attentes de la population au gouvernement.\nSa vocation est Ã©galement sociale : il s\'agit de faire parvenir la sociÃ©tÃ© Ã  la prospÃ©ritÃ©, au dÃ©veloppement, mais aussi Ã  cette notion plus chaleureuse qu\'est le bonheur, et cela passe par l\'organisation d\'Ã©vÃ¨nements divers, culturels ou sociaux.\nCertains, et c\'est naturel, ne seront toutefois rÃ©servÃ©s qu\'Ã  ceux ayant leur carte de membres ou d\'adhÃ©rents.\n\nInfluence.\n- Elle n\'a pas d\'influence directe sur l\'Ordre Citoyen, qui comme on le sait est indÃ©pendant de tout lobby et poursuit son oeuvre sociÃ©tale sans pression externe. De mÃªme, celui-ci n\'en a pas non plus sur elle, car, je le rÃ©pÃ¨te, Les Amis du Peuple est un groupe indÃ©pendant Ã©galement. Toutefois, par notre mission, nous nous plaÃ§ons de fait dans une position de relais qui offre une certaine position intÃ©ressante. \n\nDolÃ©ances.\n- L\'Ordre Citoyen, on le sait, est Ã  l\'Ã©coute du peuple. C\'est d\'ailleurs sa lÃ©gitimitÃ© la plus profonde ! De mÃªme, c\'est l\'une des raisons de son succÃ¨s. Toutefois, bien entendu, Les Amis du Peuple, par leur proximitÃ© avec les citoyens, peut jouer un rÃ´le de conseil auprÃ¨s de l\'Ordre, si nous trouvons qu\'un point en particulier mÃ©rite attention dans les affaires sociales.\n\nActions :\n- Nos actions ont deux grands axes : la communication et l\'organisation d\'Ã©vÃ¨nements. Mais pour le moment, l\'association est encore en phase de rodage, donc je ne pourrais malheureusement Ãªtre plus prÃ©cis, car nous nous devons encore d\'amÃ©liorer notre fonctionnement.\n\nActions Ã  venir :\n- Prochainement, nous comptons nous rendre dans chaque lieu du DÃ´me, Ã  la rencontre de chaque citoyen, pour les connaÃ®tre et nous faire connaÃ®tre, car c\'est la base de notre mission.\n\nCÃ´tÃ© pratique :\n- L\'association a son siÃ¨ge Ã  la brasserie de l\'Octogone, dans le Centre Ville. L\'adhÃ©sion se fait par remplissage d\'un formulaire qui n\'engage dans un premier temps Ã  rien sauf Ã  un entretien avec moi. L\'adhÃ©sion peut d\'ailleurs Ãªtre de trois types : un engagement total dans l\'association, une adhÃ©sion plus limitÃ©e mais qui a aussi son lot de responsabilitÃ©, et enfin une adhÃ©sion trÃ¨s libre qui permet d\'assister aux Ã©vÃ¨nements organisÃ©s de temps Ã  autres par Les Amis du Peuple. \nNous n\'avons pas encore de tÃ©lÃ©phone ni de site intranet, mais cela ne saurait tarder.\n\nMais pour en savoir plus, venez-nous voir ! \n\n\n[ Bien souvent durant l\'interview, Monsieur White avait lÃ¢chÃ© de lÃ©gers rires et avait souri avec sympathie, comme s\'il se trouvait en face d\'une camÃ©ra. Pourtant, sur le papier, on ne verrait rien de ses mimiques. L\'interview terminÃ©e, il fit craquer les jointures de ses doigts, puis reprit, sÃ©rieusement : ]\n\n\" Qu\'en pensez-vous ? Monsieur Montclar ? Lycia ?\nVoyez-vous des choses Ã  ajouter ? A revoir ?\nJe n\'ai pas rÃ©pondu, volontairement, Ã  vos questions sur ma conception de la politique de l\'OC, car je n\'ai pas Ã  donner mon avis qui serait d\'ailleurs inutile ! Nous sommes dans un journal sÃ©rieux aprÃ¨s tout ! [ajouta t-il sur le ton de la plaisanterie sans plaisanter vraiment.] De mÃªme, je ne prÃ©fÃ¨re rien dire sur la partie critiques. Il vaut mieux ne pas se faire d\'ennemis, et critiquer personne... Et puis, pour le moment, je trouve de toute faÃ§on que les camarades citoyens sont somme toute admirables Ã  tout point de vue ! \" [dit-il en faisant comme s\'il parlait d\'enfants. ]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL, NULL),
