e du citoyen :\n\nLoki Hvedrung\n\nFait le 12/02/2044.\n\nSignature du capitaine :]\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\nBienvenue sur le site Dom Net officiel de la [b]Section Technique et Scientifique[/b] des Forces de l\'Ordre. \n[i]Ce site fait parti du systÃ¨me d\'information de l\'Ordre : [b][link=dww.police.ord]dww.police.ord[/link][/b].[/i]\n\n[b][color=yellow]Nouveau ![/color][/b] Vous pouvez contacter la Section Technique et Scientifique par tÃ©lÃ©phone au [b]981-1183[/b] !\n\nA partir de ce site vous pourrez accÃ©der :\n- aux dossiers d\'enquÃªte en cours.\n- aux rapports d\'analyse (autopsies, recherches biomÃ©triques, etc...).\n- Ã  l\'activitÃ© courante et la position des agents sur le terrain ([color=blue]en projet[/color]).\n\nPour toute question relative au fonctionnement du portail ou pour signaler un problÃ¨me, veuillez prendre contact avec l\'administrateur du site. Toutes les questions d\'ordre juridiques ou administratives doivent Ãªtre adressÃ©es au [color=orange]Lieutenant Vernon Sullivan[/color].\n\n[i]Veuillez utiliser vos identifiants de connexion pour accÃ©der Ã  votre portail agent.[/i]\n\n[color=green][b]Informations publiques :[/b][/color]\n\nNouvelles recrues de la section :\n- [color=orange]Loki Hvedrung[/color] ([color=yellow]Sergent[/color] et administrateur des systÃ¨mes d\'information).\n- [color=orange]Saeko Tanaka[/color] ([color=yellow]Agent[/color] et responsable de la base de donnÃ©es relatives aux empreintes et Ã  la biomÃ©trie).\n- [color=orange]Erna Liang[/color] ([color=yellow]Agent[/color] et responsable des projets \"tÃ©lÃ©communication et tÃ©lÃ©surveillance\")\n\nNouveaux stagiaires de la section : \n- [color=orange]Liyah Marley[/color] (mÃ©decine), \n- [color=orange]Zerratul[/color] (informatique), \n- [color=orange]Stephen Blackberg[/color] (chimie), \n- [color=orange]Aram Scobald[/color] (ballistique).