[/link]\n[link=sts.net/34]Zerratul[/link]\n[link=sts.net/31]Stephen Blackberg[/link]\n[link=sts.net/32]Aram Scobald[/link]\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[i]Bienvenue sur le forum de discussion des agents et stagiaires de la Section Technique et Scientifique.\nCe systÃ¨me a Ã©tÃ© mis en place afin que les agents en dÃ©placement puissent toujours rester en contact avec la section dÃ¨s lors qu\'ils ont accÃ¨s Ã  un ordinateur public ou personnel.\n\nÃ‰crivez tout nouveau message au dessus des prÃ©cÃ©dents afin que l\'Ã©dition soit plus aisÃ©e lorsqu\'il y aura un grand nombre de messages. Prenez-soin d\'indiquer l\'identitÃ© de la personne qui Ã©crit ainsi que la date et heure du message en en-tÃªte, vous pouvez Ã©galement ajouter le lieu d\'oÃ¹ vous Ã©crivez votre message ainsi qu\'un sujet si il s\'agit d\'une rÃ©ponse Ã  un message particulier.[/i]\n\n[link=sts.net/19]Retour Ã  l\'accueil[/link] - [link=dom.net/modpage?21]Ajouter un message[/link]\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Loki Hvedrung, le 2044/04/07 05:17]\n[b]Lieu :[/b] [color=yellow]Imprimerie, Quartier Est[/color]\n[b]Sujet :[/b] [color=orange]Identification[/color]\n\n\"Vous pouvez utiliser le numÃ©ro de tÃ©lÃ©phone sur la page d\'accueil du S.T.S. pour le contact extÃ©rieur, Ã§a pointe sur le tÃ©lÃ©phone dont je me sers, je ferais office de bureau d\'accueil en attendant mieux. A propos des radio, j\'ai cru comprendre que la section de SÃ©rÃ©nitÃ© Urbaine s\'Ã©tait mis d\'accord sur une frÃ©quence d\'Ã©mission, Ã  nous de choisir la nÃ´tre. Quant aux badges, j\'ai relancÃ© le capitaine Newel avant de partir en mission mais je compte bien retourner le voir aprÃ¨s, le sergent Garius Costa possÃ¨de son badge donc je pense que la machine qui les fabrique est rÃ©parÃ©e.\"\n\n[b]Sujet :[/b] [color=orange]Outils de travail[/color]\n\n\"Je vous autorise Ã  disposer d\'un espace au sein mÃªme du S.T.S. pour faire vos travaux d\'informatique et d\'Ã©lectronique. Quant Ã  la commande, j\'irai moi mÃªme vous chercher un ordinateur portable aux stocks, avec le nÃ©cessaire si possible, sinon pour le kit d\'analyses et l\'appareil photo numÃ©rique, ils sont en la possession de l\'agent Tanaka, veuillez voir Ã§a avec elle.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang, le 2044/04/06 09:15]\n[b]Lieu :[/b] [color=yellow]Imprimerie, Quartier Est[/color]\n[b]Sujet :[/b] [color=orange]Identification[/color]\n\n\"Actuellement, nous ne pouvons nous identifier. Nous ne pouvons donner le numÃ©ro de tÃ©lÃ©phone officiel soit de la tour de l\'ordre soit de notre service pour confirmer notre identitÃ©. Nous ne pouvons pas non plus demander Ã  un collÃ¨gue de nous rejoindre faute de canal radio authentifiÃ©.\n\nJe demande donc s\'il ne serait pas possible de nous faire un badge d\'authentification [HJ: Ã  dÃ©faut d\'Ãªtre automatisÃ©, nous pourrions donner ce badge Ã  la personne auprÃ¨s de laquelle nous voudrions nous autentifier, badge qui nous serait rendu], de doter l\'unitÃ© et la tour d\'un numÃ©ro d\'appel [HJ: Ã  dÃ©faut d\'un appel gratuit, les PNJ des lieux pourraient avoir un tÃ©lÃ©phone portable activÃ©], et enfin, puisque le problÃ¨me des radio semble rÃ©solu, de dÃ©finir un canal d\'appel pour l\'unitÃ©.\"\n\n[b]Sujet :[/b] [color=orange]Outils de travail[/color]\n\n\"Je souhaiterais avoir l\'accord de ma hiÃ©rarchie pour pouvoir soit retirer aux stocks soit acheter les instruments nÃ©cessaires Ã  mes missions, Ã  savoir : un ordinateur portable avec accessoires  (cÃ¢blage pour mise en parallÃ¨le de disques durs), kit de prÃ©lÃ¨vement d\'empreintes gÃ©nÃ©tique ou digitales. Je souhaiterais aussi avoir l\'autorisati