e sÃ©curitÃ© est de ne pas les mettre sur un forum de discussion. Aussi attendrais-je d\'avoir un accÃ¨s aux pages du projet liÃ© Ã  la sÃ©curisation pour dÃ©velopper les mesures correctives. \n\nLes ordinateurs sont accessibles en divers endroits. Le premier reste le bureau du principal Ã  l\'universitÃ©. Il est possible aussi d\'en acheter au \"Petit Saigon\". \n\nJe suis par ailleurs Ã©tonnÃ© que sur le projet de la gÃ©olocalisation, il n\'y ai aucune information relative Ã  ce projet, ni mÃªme le teneur de base du sujet de recherche. Je ne pourrais me pencher dessus plus en avant sans avoir quelques dÃ©tails techniques supplÃ©mentaires. Par ailleurs, je me concentre sur le systÃ¨me liÃ© Ã  la radio communication et Ã  la tÃ©lÃ©phonie. Je crois que j\'aurais besoin d\'un atelier d\'Ã©lectronique pour avancer sur ce projet : en existe-t-il au sein de la tour de la police?\n\nVous avez fait mention au rÃ©seau Dom Net : pourriez vous me dire oÃ¹ je pourrais rencontrer leurs administrateurs ou oÃ¹ je pourrais trouver leurs locaux ?\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Loki Hvedrung le 2044/03/10 03:41]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]SÃ©curitÃ© du rÃ©seau[/color]\n\n\"Les ordinateurs de la section sont connectÃ©s au rÃ©seau Dom Net par fibre optique et font office de serveur pour le portail agents, comme l\'administration ne possÃ¨de pas de serveur Ã  proprement parlÃ©, on est bien obligÃ© de faire avec les moyens du bord. N\'oublions pas tout de mÃªme que nous sommes la premiÃ¨re section a s\'Ãªtre Ã©quipÃ© d\'un portail et que nous sommes prÃ©curseur dans ce domaine, si les autres nous rejoignent nous pourrons certainement demander plus de moyens pour dÃ©ployer de vÃ©ritables architectures rÃ©seaux sÃ©curisÃ©es.\n\nQuant Ã  l\'accessibilitÃ© du site, il est vrai que les seules solutions proposÃ©es par Dom Net est l\'ouverture gÃ©nÃ©rale des sites au public, la seule solution est de sÃ©curiser au maximum les pages privÃ©es derriÃ¨re des authentifications fortes. Si vous souhaitez apporter des modifications de sÃ©curitÃ© au portail, vous pouvez m\'en faire part.\n\nUne derniÃ¨re question : oÃ¹ avez-vous trouvÃ© un ordinateur Ã  l\'extÃ©rieur ?\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/09 20:40]\n[b]Lieu :[/b] \n[b]Sujet :[/b] [color=orange]SÃ©curitÃ© du rÃ©seau[/color]\n\n\"L\'accessibilitÃ© via Wifi ne semble pas plus sÃ©curisÃ©e que les postes connectÃ©s via port USB. La reconnaissance physique des ordinateur ou la reconnaissance de clefs numÃ©rique ne semble pas exister. N\'importe quel ordinateur eut se connecter au rÃ©seau sÃ©curisÃ©.\nConcernant les droits, je n\'ai pas accÃ¨s Ã  ceux relatifs Ã  la sÃ©curisation du systÃ¨me de sÃ©curitÃ© informatique. Pour ce qui est de la sÃ©curitÃ© des mots de passe, je vais y adjoindre une clef de cryptage et il serait effectivement pertinent de ne pas utiliser les noms de familles.\nEnfin, pour ce qui est des tentatives d\'intrusions, l\'important n\'est pas leur nombre, mais l\'importance des donnÃ©es collectÃ©es ou modifiÃ©es. Il me sera facilement, via notre systÃ¨me, possible d\'incriminer n\'importe quel agent dans n\'importe quel crime ou affaire en cours. Et si je peux le faire, n\'importe qui d\'autre pourra le faire aussi avec un peu d\'imagination et de ressource. C\'est un exemple sciemment caricatural et excessif, mais qui aura, je l\'espÃ¨re, pour effet d\'Ãªtre parlant. \nJe vais donc travailler sur cet aspect de sÃ©curisation des postes et des rÃ©seaux. Qui Ã©tait, jusqu\'alors, responsable de la sÃ©curitÃ© informatique afin que je puisse me rapprocher de lui ?\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Loki Hvedrung le 2044/03/08 03:47]\n[b]Lieu :[/b] [color=yellow]Brasserie de l\'Octogone[/color]\n[b]Sujet :[/b] [color=orange]SÃ©curitÃ© du rÃ©seau[/color]\n\n\"J\'ai pris bonne note de tes informations Ã  propos de la sÃ©curitÃ© du systÃ¨me d\'information. Je t\'ai ouvert un dossier d\'Ã©tude pour que tu puisses faire le diagnostic de ce qui ne va pas et Ã©ventuellement comment les rÃ©soudre. Pour ma part, j\'ai vÃ©rifiÃ© le systÃ¨me de droits et je ne constate pas de problÃ¨me majeur Ã  la sÃ©curitÃ©. Certes il est toujours impossible de gÃ©rer finement les droits d\'accÃ¨s mais dans notre cas Ã§a semble suffisant. Concernant la sÃ©curitÃ© des mots de passe, on peut la voir Ã  la hausse si nÃ©cessaire, mais je ne pense pas qu\'il y aura beaucoup de tentatives d\'intrusion. AprÃ¨s c\'est aussi peut Ãªtre une question d\'organisation, et lÃ  je suis attentif Ã  tes propositions.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/07 01:50]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]Organisation du rÃ©seau[/color]\n\n\"L\'organisation actuelle du rÃ©seau laisse prÃ©sager Ã  moyen terme des difficultÃ©s considÃ©rables. En effet, il va Ãªtre dans un moyen terme trÃ¨s difficile de s\'y retrouver, faut d\'index correct ou de rÃ©fÃ©rencement efficace.\n\nComme je l\'ai suggÃ©rÃ© par oral, l\'index principal risque de devenir illisible, vu que toutes les pages s\'y trouvent rÃ©fÃ©rencÃ©es. Aussi, je prÃ©conise que seules soient indexÃ©es les pages de rÃ©fÃ©rencement qui pointeront vers les fiches particuliÃ¨res. (---> : lien URL)\n\nPages principale\n---> Fichiers d\'empreintes (rÃ©fÃ©rencÃ©)\n---> Fichiers Balistiques (rÃ©fÃ©rencÃ©)\n---> Fichiers de recherche (rÃ©fÃ©rencÃ©)\n\nFichier d\'empreintes (non rÃ©ferencÃ©)\n---> fiche #1 (non rÃ©ferencÃ©)\n---> fiche #2 (non rÃ©ferencÃ©)\n---> fiche #3 (non rÃ©ferencÃ©)\n---> .... (non rÃ©ferencÃ©)\n\nCe mode d\'organisation permettrait d\'Ã©viter que la fiche d\'empreinte devienne illisible Ã  partir de 30 ou 40 prÃ©lÃ¨vements empilÃ©s les uns sur les autres. Il faudra juste prÃ©voir quelques fiches d\'avance pour les prÃ©lÃ¨vements ultÃ©rieurs : il semble peu raisonnable que l\'administrateur rÃ©seau soit interpelÃ© Ã  chaque prÃ©lÃ¨vement. A moins de mettre un fichier tampon que l\'administrateur vide Ã  mesure qu\'il crÃ©e les fiches...\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Loki Hvedrung  le 2044/03/06 10:54]\n[b]Lieu :[/b] [color=yellow]Brasserie de l\'Octogone[/color]\n[b]Sujet :[/b] [color=orange]-Aucun-[/color]\n\n\"Alors je vais rÃ©pondre Ã  vos diffÃ©rentes questions dans l\'ordre si vous voulez bien :\n\n- Alors si j\'ai choisi de placer les messages de cette faÃ§on, c\'est parce que dÃ©jÃ  avec le nombre de messages, on est obligÃ© systÃ©matiquement de descendre tout en bas de la page pour Ã©crire un nouveau message, et plus le temps passera, plus Ã§a sera problÃ©matique, je ne fais qu\'anticiper.\n\n- Le portail officiel de l\'Ordre n\'a rien Ã  voir avec le portail du STS, les identifiants ne sont pas partagÃ©s entre les deux sites et moi mÃªme je n\'ai aucun accÃ¨s au portail de la police, pour Ã§a il faut aller demander Ã  l\'agent Sam Johnson. Si le lien vers le STS est mort, j\'irai voir l\'agent pour lui dire.\n\n- Pour la crÃ©ation d\'un fichier d\'empreinte, je veux bien vous confier la crÃ©ation et la maintenance si vous le souhaitez. Pouvez-simplement me communiquer ce que vous comptez exactement y mettre Ã  l\'intÃ©rieur ?\"\n\n- Concernant le rapport d\'enquÃªte, faites au mieux, moi j\'ai l\'habitude de dÃ©crire trÃ¨s prÃ©cisÃ©ment les faits afin que Ã§a puisse convenir Ã  tous les publics et que l\'on n\'accuse pas la section scientifique de bÃ¢cler les enquÃªtes et les rapports qui vont avec.\n\n- Effectivement, c\'est Ã©vident de dÃ©terminer les logins de chacun puisqu\'il s\'agit de nos noms de famille, mais je compte sur la sÃ©curitÃ© du mot de passe. AprÃ¨s, mis Ã  part le compte administrateur que j\'ai protÃ©gÃ© au mieux, les accÃ¨s de chacun sont trÃ¨s limitÃ©s et affectÃ©s de faÃ§on unitaire sur chaque page, je compte donc sur votre discrÃ©tion. Si vous voulez faire un rapport de sÃ©curitÃ© sur le site, libre Ã  vous et je prendrai bonne note de vos remarques.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/05 12:31]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]SÃ©curitÃ© du rÃ©seau[/color]\n\n\"La communication et le maintien du contact sont antinomiques avec la sÃ©curitÃ© du systÃ¨me. L\'initiative est pleine de bonnes intentions. Ceci Ã©tant, si une personne autorisÃ©e peut accÃ©der Ã  notre rÃ©seau de n\'importe oÃ¹, n\'importe qui peux le faire tout autant. Toute connexion peut Ãªtre interceptÃ©e, analysÃ©e et mise Ã  profit pour une attaque en rÃ¨gle du rÃ©seau.\n\nPar ailleurs, le login et le mot de passe sont deux Ã©lÃ©ments participant l\'un et l\'autre Ã  la sÃ©curisation du systÃ¨me. Si par exemple, \"tanaka\", \"hvedrung\"  ou \"sullivan\" est un login, la moitiÃ© du chemin est dÃ©jÃ  parcouru pour pÃ©nÃ©trer nos dÃ©fenses. \n\nSi vous le souhaitez, je peux tenter de combler ce failles.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/05 12:31]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]Note relative au rapport d\'enquÃªte[/color]\n\n\"Ce rapport reflÃ¨te parfaitement les difficultÃ©s que j\'ai rencontrÃ© lors de ma premiÃ¨re semaine de stagiarisation : le manque d\'information. Personne ne connait l\'identitÃ© de la victime ou du suspect. Mais qu\'y pouvons nous s\'ils n\'avaient pas leurs visas sur eux... Ceci Ã©tant, je vous laisse le soin de lire mes rapports manuscrits quant Ã  certains projets.\n\nHormis cela, je ne puis pas ajouter grand chose : je ne suis pas experte ni en rapports, ni en enquÃªtes policiÃ¨res. Ceci dit, je suis plus directe dans mes analyses et conclusions : le lecteur ne se perds pas dans les dÃ©tails qui ne l\'intÃ©resse pas forcÃ©ment.\n\nEnfin, j\'ai tenu compte de vos remarques et ai corrigÃ©.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/05 12:31]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]Demande de crÃ©ation de fichier[/color]\n\n\"Je souhaiterais que soit crÃ©Ã© un fichier d\'empreintes. Si vous pouviez m\'en laisser la responsabilitÃ©, j\'en serais fort heureuse et vous pourriez me donner votre avis.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/05 12:31]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]Site gÃ©nÃ©ral de la police[/color]\n\n\"Sur le portail suivant : dww.police.ord/9, les mots de passe et login Ã  entrer sont-ils les mÃªmes que ceux de la STS? Ou d\'autre? Par ailleurs, le lien qui redirige vers la STS est un lien mort Ã  moins que ce ne soit mon mot de passe qui soit invalide.\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Erna Liang le 2044/03/05 12:31]\n[b]Lieu :[/b] [color=yellow]Section Technique et Scientifique[/color]\n[b]Sujet :[/b] [color=orange]Forum de discussion[/color]\n\n\"Afin de rendre plus simple la lecture, ne serait-il pas intÃ©ressant de mettre les nouveaux messages au dessus des anciens, afin que les plus rÃ©cents se retrouvent en dÃ©but de page?\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n[Par Loki Hvedrung le 2044/03/04 11:18]\n[b]Lieu :[/b] [color=yellow]Tour de la Paix[/color]\n[b]Sujet :[/b] [color=orange]-Aucun-[/color]\n\n\"VoilÃ , Ã©tant donnÃ© que j\'ai souvent accÃ¨s Ã  un ordinateur lorsque je suis en dÃ©placement, j\'ai trouvÃ© que c\'Ã©tait une bonne idÃ©e de mettre en place un petit systÃ¨me de communication Ã  distance pour rester en contact avec la section.\n\nJ\'ai vu que vous aviez ajoutÃ© des Ã©lÃ©ments dans le dossier d\'enquÃªte, par contre je ne sais qui parmi les 3 personnes a Ã©crit le message. L\'en-tÃªte correspond Ã  la personne qui a ajoutÃ© le paragraphe dans le dossier, si vous voulez faire mention des personnes qui ont participÃ©, faites le dans le corps du paragraphe.\n\nSinon qu\'avez-vous pensÃ© du rapport si vous l\'avez lu ?\"\n\n-------------------------------------------------------------------------------------------------------------------------------------------------\n\n\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL, NULL);
