(13814, 253, NULL, '0', 'Transit.inactifs', NULL, NULL, NULL, NULL, NULL, 1, NULL, 10, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Article 1 â€“ Le tribunal\n\nArticle 1.a â€“ Le juge\n\nLe Juge est nommÃ© par le SecrÃ©tariat central de l\'Ordre Public. Il est chargÃ© d\'instruire les conflits juridiques, de juger de la qualitÃ© des preuves apportÃ©es par la Police, les plaignants et la partie\ndÃ©fendante, dâ€™organiser le jugement et de prononcer les sentences.\n\nLes sentences seront Ã©tablies en accord avec les lois, et devront Ã  ce titre Ãªtre appuyÃ©es par les articles enfreints par la personne condamnÃ©e. \n\nLes sentences devront prendre en compte les circonstances attÃ©nuantes ou aggravantes, notamment : la nature de l\'infraction commise, la victime du forfait, la rÃ©cidive Ã©ventuelle, etc.\n\nArticle 1.b - L\'accusation\n\nLe rÃ´le de l\'accusation est dÃ©volu Ã  la police, qui devra fournir au juge les preuves et tÃ©moignages inculpant l\'accusÃ©. (Voir Article 2)\n\nArticle 1.c - La dÃ©fense\n\nLa dÃ©fense d\'un accusÃ© peut Ãªtre assurÃ©e par un avocat choisi par cet accusÃ©. Le juge est tenu d\'Ã©couter et de prendre en compte toute intervention d\'un avocat. (Voir Article 3)\n\nArticle 2 - La police\n\nArticle 2.a - La police peut Ã  tout moment demander aux citoyens de lui fournir des informations au sujet d\'une enquÃªte en cours, pour ce faire ils pourront donc :\n- Demander Ã  un prÃ©sumÃ© tÃ©moin d\'infraction de se rendre Ã  la tour de la Paix pour y Ãªtre entendu.\n- Convoquer un prÃ©sumÃ© coupable, lequel devra dans ce cas l\'accompagner immÃ©diatement pour un interrogatoire.\n- User de la force pour emmener un prÃ©sumÃ© coupable, des lors qu\'il existe des Ã©lÃ©ments concrets permettant de supposer que l\'individu constitue un danger s\'il reste libre de ses mouvements.\n- Mettre hors d\'Ã©tat de nuire un criminel avÃ©rÃ© en cas de flagrant dÃ©lit d\'agression physique.\n\nDans tous les cas, le fonctionna