:\n\nIls sont constituÃ©s des dommages et empÃªchements faits aux libertÃ©s fondamentales entrainant des prÃ©judices physiques ou moraux graves pouvant conduire Ã  la mort (mÃªme si, par lâ€™intervention\nefficace de soins, celle-ci nâ€™est pas effective au moment du procÃ¨s), ou ayant conduit Ã  la mort.\n\nLes meurtres, viols, emprisonnement, destructions dâ€™institutions publiques, Ã©meutes sont des exemples de prÃ©judices criminels punis par la loi.\n\nLa peine encourue pour un prÃ©judice majeur consiste gÃ©nÃ©ralement en une peine de prison pouvant aller jusqu\'Ã  la perpÃ©tuitÃ©, ou un bannissement du dÃ´me.\n\nArticle 7 â€“ Peines encourues :\n\nQuelque soit leurs natures, les peines peuvent Ãªtre commuÃ©es par dÃ©cision judiciaire, ou cumulables.\nLes peines sont encourues dÃ©s que le verdict est prononcÃ© et appliquÃ©es dans lâ€™ordre oÃ¹ elles ont Ã©tÃ© Ã©dictÃ©es.\n\nArticle 7.a â€“ Les amendes :\n\nLe tribunal peut demander en rÃ©paration une somme dâ€™argent dont le montant et le bÃ©nÃ©ficiaire sera dÃ©signÃ© en fonction de la nature du prÃ©judice et de la victime.\nLes citoyens qui ne pourraient pas payer d\'amende par faute de liquiditÃ©s devront accomplir un Travail d\'UtilitÃ© Collective, ou travailler au centre de rÃ©cupÃ©ration jusqu\'Ã  pouvoir payer l\'amende.\nLes amendes pourront Ãªtre saisies directement sur le salaire ou sur le compte en banque de l\'intÃ©ressÃ©, voir sur ses biens en cas de non solvabilitÃ©.\nUne amande impayÃ©e peut donner lieu Ã  une incarcÃ©ration dont la durÃ©e dÃ©pendra du montant et de la nature du prÃ©judice.\n\nArticle 7. b. 2 â€“ La libertÃ© conditionnelle\n\nElle peut Ãªtre octroyÃ©e par le juge en cas de prÃ©judices mineurs voire majeurs, si le risque de rÃ©cidive peut-Ãªtre formellement Ã©cartÃ© et pour\npeu que le contrevenant atteste de sa bonne volontÃ© et dâ€™un passÃ© antÃ©dÃ©lictueux et irrÃ©prochable.\nElle peut Ãªtre prononcÃ©e aussi pour lâ€™exÃ©cution du Travail dâ€™UtilitÃ© Collective.\n\nLa libertÃ© conditionnelle est gÃ©nÃ©ralement sujette au paiement d\'une caution, de 1000 Cr par jour d\'emprisonnement restant.\n\nArticle 7. b. 3 â€“ Le Travail dâ€™UtilitÃ© Collective\n\nIl devra servir Ã  la collectivitÃ© en vu de la construction, lâ€™amÃ©lioration ou le maintien du bien Ãªtre de lâ€™ensemble des citoyens du dÃ´me. Son lieu dâ€™exercice et sa durÃ©e sera laissÃ© Ã  la discrÃ©tion du Juge et tiendra compte de la nature du prÃ©judice.\n\nArticle 7. b. 4 â€“ La mesure d\'incarcÃ©ration temporaire\n\nSelon la nature du prÃ©judice, le Juge ou la direction de la Police peuvent prononcer des mesures dâ€™emprisonnement prÃ©ventif. Des locaux appropriÃ©s seront mis Ã  disposition dans ce but.\n\nArticle 7. b. 5 â€“ La peine d\'exil\n\nEn cas de prÃ©judices criminels, le juge peut dÃ©cider dâ€™une peine d\'exil hors du DÃ´me pour maintenir la paix publique et assurer le bien Ãªtre collectif, et ce, quelque soit la gravitÃ© du dÃ©lit. L\'exilÃ© devra porter une puce qui l\'identifiera et signalera Ã  la Douane la durÃ©e de sa peine, afin de s\'assurer qu\'il ne rentre pas avant terme.\nCette peine pourra Ãªtre commuÃ©e sur dÃ©cision judiciaire.\n\n\nArticle 8 â€“ La prÃ©servation des libertÃ©s fondamentales :\nmesures particuliÃ¨res\n\nLa communautÃ© se doit dâ€™agir pour son bien Ãªtre. La fonction publique sous l\'autoritÃ© du SecrÃ©tariat central de l\'Ordre Public a pour but de prÃ©server la paix et le bien Ãªtre des citoyens du dÃ´me.\nEn cas de manquement Ã  cette rÃ¨gle Ã©lÃ©mentaire dâ€™un fonctionnaire, le Juge peut en tenir compte comme circonstance aggravante sauf si-celui ci avait tentÃ© de promouvoir, par ses actes, les intÃ©rÃªts de l\'Ordre Citoyen, c\'est-Ã -dire l\'intÃ©rÃªt gÃ©nÃ©ral.\nCertaines mesures existent pour agir dans lâ€™intÃ©rÃªt du bien Ãªtre de la communautÃ©.\n\n\nArticle 8.a â€“ Les armes.\n\nLa paix est le bien le plus prÃ©cieux qu\'a pu acquÃ©rir l\'Ordre Citoyen pour l\'offrir au DÃ´me entier. Il convient de la prÃ©server. Pour ce faire, et pour garder le chaos hors des limites de la ville, le Gouvernement se doit d\'imposer une stricte rÃ¨glementation en ce qui concerne la vente, la dÃ©tention et le port d\'armes.\n\nArticle 8.a 1 â€“ Les armes Ã  feu.\n\nLa vente, la dÃ©tention et le port d\'armes Ã  feu sont strictement prohibÃ©s dans le DÃ´me, Ã  l\'exception des cas suivants :\nLes membres des forces de la Police de Cybercity sont habilitÃ©s Ã  dÃ©tenir et porter une arme Ã  feu, en respect de son rÃ¨glement intÃ©rieur. Le badge de Police vaut permis de port d\'armes Ã  feu dans ce cas prÃ©cis.\nCertains membres de l\'Ordre Citoyen peuvent obtenir l\'autorisation de dÃ©tenir et porter une arme Ã  feu, comme les agents de sÃ©curitÃ© officiels. Dans ce cas, ils doivent possÃ©der un permis exceptionnel de port d\'armes Ã  feu.\nTout manquement Ã  ces lois peut faire lâ€™objet dâ€™une condamnation en prÃ©judice majeur.\n\nArticle 8.a 2 â€“ Les armes blanches.\n\nIl existe quatre catÃ©gories d\'armes blanches. Selon la catÃ©gorie concernÃ©e, les lois et les modalitÃ©s d\'usage ne sont pas les mÃªmes.\n\nLes armes par destination (AD) : Elle comprend tous les objets dont l\'usage premier n\'est pas d\'Ãªtre une arme. Cela peut-Ãªtre : un tournevis, une clÃ© Ã  molette, une bÃ©quille, un couteau de cuisine, etc.\nLeur vente, dÃ©tention et port ne sont pas interdits ni contrÃ´lÃ©s, mais un agent de la Police peut tout Ã  fait agir en cas de comportement suspect d\'un citoyen possÃ©dant tel objet.\n\nLes armes de protection (AP) : Elle comprend toutes les armes dont l\'usage premier est de se dÃ©fendre de faÃ§on limitÃ©e en cas d\'agression par un tiers. Cela peut-Ãªtre : une matraque, une bombe lacrymogÃ¨ne, un poing amÃ©ricain etc.\nLa vente de ces objets est libre, mais leur dÃ©tention et port sont contrÃ´lÃ©s. Leurs propriÃ©taires se doivent ainsi d\'acquÃ©rir et de possÃ©der le permis de port d\'armes AP.\n\nLes armes de d\'apparat (AA) : Elle comprend toutes les armes de bonne facture dont l\'usage premier est d\'Ãªtre exposÃ©, de servir de dÃ©coration ou d\'apparat pour un spectacle. Cela peut-Ãªtre : des Ã©pÃ©es , des lames ouvragÃ©es, des lances.\nLe fabricant et vendeur de tels objets a l\'obligation de vÃ©rifier que le client demandeur dispose bien d\'une autorisation de dÃ©tention d\'armes AA, que celui a l\'obligation d\'avoir pour acquÃ©rir une telle arme. \nIl devra toujours possÃ©der l\'autorisation sur lui, et limiter au maximum ses dÃ©placements avec ce genre d\'armes, sous peine d\'arrestation par les forces de la Police.\nLe fabricant ou vendeur a quant Ã  lui l\'obligation de limiter au maximum la distribution de ce genre d\'armes.\nIl est Ã  noter que la Tour de la Paix dÃ©livre trÃ¨s peu d\'autorisations de dÃ©tention d\'armes AA, la demande de celle-ci devant Ãªtre fortement justifiÃ©e.\n\nLes armes interdites (AI) : Elle comprend toutes les autres armes blanches, dont l\'usage premier n\'est ni de se dÃ©fendre de faÃ§on limitÃ©e, ni d\'Ãªtre exposÃ©. Cela peut Ãªtre : un couteau de combat, les armes blanches de mauvaise facture etc) Leur vente, dÃ©tention et port sont strictement prohibÃ©s.\n\n\nArticle 8.a 3 â€“ Les autorisations de dÃ©tention et de port d\'armes.\n\nLa dÃ©tention et le port d\'armes Ã  feu sont exclusivement rÃ©servÃ©s aux membres de la Police et certains membres de l\'Ordre Citoyen.\nLa vente, la dÃ©tention et le port dâ€™armes blanches doivent Ãªtre validÃ©s par certaines autorisations selon les catÃ©gories d\'armes.\nLes personnes de moins de 15 ans n\'ont accÃ¨s qu\'aux armes AD, et ont totale interdiction d\'acquÃ©rir des armes d\'autres catÃ©gories.\nLes autorisations de dÃ©tention et port dâ€™armes AP et AA nÃ©cessitent lâ€™achat dâ€™un brevet dâ€™attestation octroyÃ© Ã  la Tour de l\'Ordre. La personne se verra remettre un formulaire Ã  remplir.\nLes tarifs des redevances perÃ§ues par l\'administration pour la dÃ©tention d\'arme par des citoyens seront fixÃ©s par un dÃ©cret gouvernemental, il en sera de mÃª