n, le partage de toutes les ressources, matÃ©riels ou financiÃ¨res des personnes, ainsi quâ€™un patronyme commun sâ€™ils le souhaitent. Les conjoints deviennent hÃ©ritiers lâ€™un de lâ€™autre en cas de dÃ©cÃ¨s.\nLe mariage est unique et ne peut Ãªtre contractÃ© avec plusieurs personnes simultanÃ©ment.\n\nArticle 9.c. 2 â€“ Le Divorce\n\nLe divorce est dÃ©livrÃ© par un dÃ©tenteur de lâ€™autoritÃ© judiciaire. Les biens doivent Ãªtre partagÃ©s de maniÃ¨re Ã©quitable aprÃ¨s le divorce, en tenant compte du montant des ressources des conjoints\ndivorcÃ©s.\nLâ€™autoritÃ© judiciaire dÃ©signe aussi le tuteur des enfants mais, pour autant, le conjoint sÃ©parÃ© ne sera pas dispensÃ© de son devoir de subsistance auprÃ¨s des enfants issus du mariage.\n\nArticle 9.c.3â€“DÃ©cÃ¨s\n\nEn cas de dÃ©cÃ¨s, un Juge est dÃ©signÃ© pour prendre en charge l\'inventaire et le partage de la succession. Toute succession n\'ayant pas Ã©tÃ© portÃ©e Ã  la connaissance du Juge sera dÃ©clarÃ©e illÃ©gale.\nEn cas de testament dÃ©posÃ© auprÃ¨s de la mairie, l\'autoritÃ© judiciaire aura en charge la rÃ©partition des biens selon les volontÃ©s du dÃ©cÃ©dÃ©.\nSi aucun testament n\'a Ã©tÃ© enregistrÃ©, la totalitÃ© des biens du dÃ©funt est partagÃ©e par celle-ci entre les parents, en partant du parent le plus proche (conjoint ou premier enfant).\nDans l\'Ã©ventualitÃ© ou aucun successeur, reconnu lÃ©gitime par l\'autoritÃ© judiciaire, ne se prÃ©senterait, les biens mobiliers et immobiliers de la personne dÃ©cÃ©dÃ©e reviennent Ã  lâ€™Ã‰tat, y compris les participations dans le capital d\'entreprises. L\'institution bancaire est tenue d\'identifier les diffÃ©rents comptes ayant appartenu au dÃ©funt, et d\'y donner tous accÃ¨s nÃ©cessaires Ã  l\'administration pour leur liquidation au bÃ©nÃ©fice de lâ€™Ã‰tat.\n\n\nArticle 9.d - Le mineur\n\nLes parents d\'un mineur lui doivent assistance et subsistance. Si la preuve est faite qu\'aucun des deux parents ne peut s\'acquitter de ce devoir, la communautÃ© pourra se substituer Ã  leur rÃ´le en soutenant le ou les parent(s) via une contribution financiÃ¨re ou participative dont le montant\nou la nature sera laissÃ©e Ã  la discrÃ©tion du maire.\n\nArticle 9.e â€“ La Tutelle\n\nLa tutelle s\'ouvre sur un mineur lorsque le pÃ¨re et la mÃ¨re sont tous deux dÃ©cÃ©dÃ©s ou inconnus ou que ni lâ€™un ni lâ€™autre ne l\'aient officiellement reconnu.\nLe tuteur est lui-mÃªme majeur et citoyen du dÃ´me et est dÃ©signÃ© jusquâ€™Ã  la majoritÃ© de lâ€™enfant. Il doit Ãªtre d\'accord pour exercer son devoir de tutelle.\nLe mineur doit assister Ã  la prise de dÃ©cision concernant le choix de son tuteur.\nLe tuteur doit protection et nourriture a l\'enfant. Il administrera ses biens en chef de famille responsable et rÃ©pondra des dommages et intÃ©rÃªts qui pourraient rÃ©sulter d\'une mauvaise gestion ainsi que des dÃ©lits commis par le mineur.\nPeuvent Ãªtre exclus ou destituÃ©s des diffÃ©rentes charges de la tutelle les gens d\'une inconduite notoire et ceux dont l\'improbitÃ©, la nÃ©gligence habituelle ou l\'inaptitude aux affaires aurait Ã©tÃ© constatÃ©e.\nSi la tutelle reste vacante, le Juge la dÃ©fÃ¨re Ã  l\'Ã‰tat qui devient responsable du dit mineur.\nLâ€™adoption est une mise sous tutelle dont lâ€™enfant devient hÃ©riter patronymique et lÃ©gataire de son tuteur.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL, NULL),
