(26311, 1221, NULL, '0', 'Transit.inactifs', NULL, NULL, NULL, NULL, NULL, 1, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Un vieux t-shirt blanc rapiécé de toutes parts et apparemment maintes fois déchiré. En lettres pourpre y trône sur le devant la phrase \"Death Is My Choice\", sur l\'extrémité de la manche droite un jolly roger blafard, minuscule. Par-dessus se porte un vieux perfecto noir usé jusqu\'a la moelle sur lequel trône de vieux badges de groupes de métal obscurs, tels que \"Napalm Death\", \"Manowar\" , \"Death\" ou \"Dying Fetus\" et arborant dans le dos un dossard au nom de \"Megadeth\" dégoulinant de sang où est marqué \"99 ways to die\". Le tout sent la sueur, le sexe et la clope.', '', NULL, NULL),
(26312, 1193, NULL, '0', 'virtuel.gritche.arbre', NULL, NULL, NULL, NULL, NULL, 1, NULL, 3, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Vieux treillis militaire plus très blanc usé jusqu\'a la corde, nottament sur les genoux et les fesses. Les poches se ferment avec un bouton pressoir qui manque a plusieurs endroits. La poche sur le tibia droit à l\'air d\'avoir servi a porté souvent un truc pointu, probablement un couteau, la poche arrière sur les fesses, elle, a la marque évidente d\'un portable type vieux nokia. Le tout sent la clope.', '', NULL, NULL),
(26313, 1195, NULL, '0', 'virtuel.gritche.arbre', NULL, NULL, NULL, NULL, NULL, 1, NULL, 9, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Chaussures renforcées de types New Rocks en cuir fatigué noir et rouge représentant des flammes et une tête de mort sur le dessus de la coque, qui d\'ailleurs sort un peu par endroit. Elles auraient put être magnifiques si ce n\'est leur état avancé de délabrement. Elles montent jusqu\'en haut du tibia, quasiment au genou.', '', NULL, NULL),
