(33523, 484, NULL, '0', 'Transit.inactifs', NULL, NULL, NULL, NULL, NULL, 1, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Journal d\'un certain Dr. C Dandelion...\n\n[HJ: texte disponible en intégralité à la demande.]\n\nPré organisqtion du dôme 2014 (20 ans de recherches et de construction)\nClarence H.Dandelion\n\nCeci est mon journal de bord. Je me nomme Clarence Heathcliff Dandelion, diplômé du MIT Massachusetts en biotechnologie, 37 ans, né à Boston en 1977. J’ai été repéré par le Dr. Manfred et invité à travailler sur le projet de sauvegarde de l’Humanité. C’était un véritable honneur pour moi de travailler avec des gens si soucieux de l’avenir. Il faut dire qu’avec les modifications climatiques et les annonces alarmistes pour le future de la planète, je n’ai pas hésité une seconde à sauter dans le train. Direction l’Alaska, des Labos flambants neufs équipés à la pointe de la technologie, la Selmer Corp avait mit les moyens pour sauver l’Humanité. Nous étions la première fournée de scientifiques à travailler pour le projet. Mes compétences en biotechnologies m’ont affiliés à la création de solutions agro-alimentaires.\nIl fallait penser ergonomique, j’ai soumis au labo le projet des animaux à chair condensées.\nC’est avant tout pour un gain de place et de rendement, même vu au détriment de l’animal lui-même.\nJanvier 2014 /Expérience n°01/projet Meatub :\nLes premiers tests ont été désastreux, sur une batterie de cinq individus, les veaux placés en condition intra-utérine dans la solution plasmatique n’ont pas survécus.\nDès les premières heures, le sujet 1 a cherché à percer les membranes nasales et buccales pour respirer, après 2h, il s’est noyé dans la solution. Nous envisageons d’enrichir la solution en concentrant le taux d’oxy-maroxys, la solution serait alors plus proche du gaz liquide qui permettrait le maintient des sujets dans un environnement respirable stable.\nLe sujet 2 n’a aucun réflexes moteurs, il reste en suspension dans la solution, déclaré mort 4h plus tard. L’extraction hors utérus à été trop brutale, le sujet de faible constitution n’a pas survécu.\n\nLe sujet 3 semble plus prometteur, il est resté en vie artificielle durant 11h. Notre premier vrai succès. \nLe sujet 4 présentait une malformation physique, présence de membres parasites en surnombre, pourtant il a dépassé les 24h de survie en milieu aqua-oxygéné, sa condition physique pose cependant un problème, le surnombre membraire affecte l\'oxygènation du cerveau du sujet, il est déclaré mort cérébrale après la 10 ème heure, les 14h suivantes ont été une pure perte en réalité.\nLe sujet 5 s\'est étouffé après avoir percé sa membrane buccale, il a ingéré une partie de la solution sans problème mais l\'air l\'a étouffé. Ils ne sont pas fait pour vivre en milieu sec.\n\nNovembre 2014 /Expérience n°02/projet Meatub :\n\nComme les sujets ont tendance à déchirer les membranes quand leur développement physique dépasse les 12h d’incubation, nous avons commencé à modifier leur physique. Plusieurs semaines de croisements génétiques et de saillies ont permis de proposer des veaux dépourvus de pattes. Ils sont la chair parfaite, un développement stable, une masse musculaire suffisante pour en tirer plusieurs kilos de viande savoureuse. Nous avons réitéré l’expérience pour notre panel d’animaux disponible, porc, vache, poulet, rat,vers, requin.\nLes animaux en bocaux ont remportés un franc succès auprès de la Haute Hiérarchie, validés et autorisés par le Conseil, ils sont la viande de demain et pour longtemps. Economiques, auto-gérés, rentables, L’Humanité du Dôme n’aura pas à souffrir de la faim, grâce aux Laboratoires de la Selmer Corp. Je suis fier d’avoir participé au projet.\nNote personnelle : \nCes porcs en bocaux vivants, n’ont aucune émotion, aucun désir, ils ignorent tout du soleil ou des champs.\n\nMai  2015 /Expérience n°03/projet Meatub :\nLa production commence à battre son plein, nous avons constaté que nous pouvions augmenter la masse musculaire des animaux. Les premiers master pièces ont été installés dans les cuves de 200 litres, des bêtes démesurées, près de 100 kilos de chairs comestibles pour un coût moindre .\nAout 2015 /Expérience n°04/projet Meatub :\nLes master pieces commencent à dégénérer, leur masse augmentent et la qualité de la viande baisse, ça prend un goût flotteux, fade, la chair est gorgée de solution. Les cellules épidermiques ne sont plus étanches, elles se gorgent de liquide et imbibent les couches suivantes, les sujets commencent à se dissoudre dans la solution après 720 heures. Il ne reste dans la cuve qu’une gélatine de cellules vivantes. C’est inutilisable. Nous avons établis la durée de vie des masterpieces à 3 mois, passé ce délai, ils se dissolvent dans la cuve. Le système de production abat donc systématiquement les viandes à partir de 2 mois et demi.\nNote Personnelle:\nJ’ai beau me réjouir de notre avancée technologique de l’agro-alimentaire du Dôme, la honte s’immisce en moi petit à petit. Et si ces animaux en bocaux souffraient en silence ? Est-ce vraiment humain d’avoir créé de telles créatures ? A-t-on cherché à dépasser l’œuvre de dieu ?\nJe n’ai jamais été un fervent religieux, mais je commence à avoir du mal à regarder mes créations. Elles n’ont plus rien d’appétissant, ce sont des boules de chairs qui flottent dans du liquide, plus je les regarde, plus elles m’écœurent. \n\nDécembre 20156/Expérience n°05/projet Meatub/Centre de clonage perpétuel :\nNous avons travaillé en étroite collaboration avec les ingénieurs en mécanique du Dôme, pour établir un système d’autogérence des cuves et de distribution vers les cuisines.\nUn français du nom de Henri Lemoine a dessiné les plans du système, je dois reconnaître que c’est un génie, il a su trouver la moindre faille du système pour le rendre invulnérable.\nC’est ainsi que nous avons déplacés toutes les masterpieces vers leur futur et éternel lieu de vie, dans les sous sols du centre de distribution. Nous avons installé les incubateurs, la morgue  et la nurserie sur deux étages. Au niveau -2, la nurserie : Le système de saillies automatiques insémine les matrices porteuses (douze matrices incubés), après 72h les pré-nés (10 par matrice) sont extraits et placés en cuve, surveillés pendant le premier mois au niveau -2, ils montent ensuite dans la chaîne du niveau -1 quand tout risques de mort prématuré ou de développement altéré est écarté. Dans quels cas, les cuves erronées sont vidés à la morgue, dans le broyeur central, et pour écarter tout risque de dégénérescence, la portée complète est éradiquée au broyeur. Le rythme en quinconce des naissances permet de palier à une élimination de portée.\nLes nouvelles masterpieces arrivées au niveau -1\nNote personnelle :\nQu’avons-nous fait ? Ces monstres en boîtes sont répugnants, j’ai renversé une cuve pour en libérer l’animal, l’étiquette indiquait « porc », mais ça ne ressemble à rien. Tout ce qui est tombé sur le sol c’est une flaque de chairs blanches translucides immonde, ça na même pas crié, ça n’aurait pas pu. Ça a gigoté une minute ou deux sur le sol et c’est mort sur le coup. Je n’ose plus les manger.\n\nMars 2015 /Expérience n°05/projet Meatub/Centre de clonage perpétuel :\nDissection : Ce sont des boules de chair, il ne leur reste plus qu’un cerveau réduit, un cœur hypertrophié pour faire tourner tous ces muscles, un système de poumons branchiales, un tube disgestif unique, qui ne prend en charge que la digestion de nutriments, un système nerveux et hormonal limité. L’absence d’oreilles, d’yeux, de bouche, d’anus et de pattes est notifié depuis la seconde vague de masterpieces.\n\nNovembre 2015 /Expérience n°05/projet Meatub/Centre de clonage perpétuel :\nLemoine a fait sceller les niveaux de production sous le centre dans une structure antisismique élaborée, les salles ne recevront aucun trouble venant de l’extérieur, c’est peut être même l’endroit le plus stable du Dôme ! Il a cependant laissé un accès humain dans cette mécanique rodée, au cas ou une intervention humaine soit nécessaire auprès des cuves, il fallait laisser un accès d’urgence. A heure fixe l’automate des commandes en gros repart dans le tunnel souterrain, avec le code adéquat pour ouvrir la porte de l’automate, il est possible d’y descendre, sans quoi c’est le broyage assuré contre la porte du centre.\n\nJanvier 2016 /Expérience n°06/projet Meatub/Centre de clonage perpétuel :\nLe système de production est optimal. Les naissances sont autonomes, l’énergie nécessaire est fournie par l’électricité musculaire faible des masterpieces et complétée par le système énergétique des membranes du dôme lui-même, en cas de destruction des membranes, le système de production pourra tourner à demi régime, tant qu’il y aura des masterpieces il y aura du courant pour faire tourner la chaine.\n\nNote personnelle : \nNous avons créé une hérésie éternelle ! Le clonage des créatures et leur consommation son éternels , c’est honteux ! Personne n’en saura jamais rien, les citoyens du Dôme se contenteront de manger en ignorant d’où provient la viande de leurs plats, je dois faire quelque chose ! Je dois les prévenir !\n\nMars 2024 Note personnelle :\nJ’ai choisi de descendre débrancher le système des masterpieces, j’attends 23h23 que l’automate descende vers le niveau 0, j’ai subtilisé le pass, je me glisserai à sa suite et irait au -1 éliminer chaque masterpiece avant de détruire les matrices du -2. (Le journal s’arrête là.)\n\n\n\n', '', NULL, NULL),
