(35055, 1251, NULL, NULL, NULL, NULL, 1896, NULL, NULL, NULL, 1, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Dossier médical 2038 OBSERVATIONS NATALITÉ.\n\nDr Jones (Hunter Jones) (Biogénéticien)\nDr Keller (Henri Keller) (Psychologue)\nDr Mordecai (Tobias Mordecai)(Généticien)\nDr Alambra (Maxime Alambra)(Gynécologue-Andrologue)\n\ntests patients 2034 > 2038\nJeremy Gorgy - âge estimé : 14\nMark Lewis - âge estimé : 16\nKara Lane - âge estimé : 17\nMorgan Dorrey  - âge estimé : 15\nJoyce Dorrey  - âge estimé : 16\nElizabeth Epona - âge estimé : 14\nGary Wyatt Philips - âge estimé : 17\nTae Sawari - âge estimé : 16\nJono Uchi Sawari - âge estimé : 18\nBeau Lloyd - âge estimé : 17\nSarah Sabrei - âge estimé : 17\nLucy Sabrei - âge estimé : 16\nJeffrey Jacob Abrahams - âge estimé : 17\n\nDr Hunter Jones\nExtrait de disque archivé sur papier\"Bonjour, je suis le Dr. Jones, et voici Maxime, mon assistante, vous pouvez m\'appeler par mon prénom Hunter. Si vous avez trouvé ma petite annonce, c\'est que vous avez besoin d\'argent de poche pour vivre tranquillement avec nous. Alors voilà ce que je vous propose, nous allons tous aller au parc, prendre le soleil et je vous expliquerai le boulot. Il y aura à manger, je précise pour ceux d\'entre vous qui aurait déjà faim. En route les enfants.\"\nça fait beaucoup d\'enfants qui disparaissent. Le mur d\'affiches au quartier sud va devenir gênant.\nLes rares enfants qui passent la douanes, portent encore suffisamment de germes pour les tests, mais ne durent pas assez longtemps pour la totalité des examens. L\'annonce d\'un petit boulot les attirent rapidement, je peux vérifier leur condition physique et pulmonaire. Il semblerai que leurs poumons se soient endurcies à l\'air de l\'extérieur, les derniers germes sont emprisonnés dans les alvéoles. J\'ai effectué une biopsie sur chacun des enfants. La pollution externe à modifier leur corps pour le rendre plus résistant.\nDans le groupe des filles, l\'examen gynécologique a démontré que toutes ont été violées, leur matrice est stable et viables mais leurs ovaires restent inactives, après le suivit psychologique du Dr. Keller, quatre d\'entre elles ont perdu l\'enfant qu\'elles portaient par fausse couche, une a mené à terme, l\'enfant n\'est jamais arrivé jusqu\'ici, les mystères de la route restent dehors.\nKara Lane - fausse couche\nMorgan Dorrey  - viol\nJoyce Dorrey  - fausse couche\nElizabeth Epona -viol\nTae Sawari  - fausse couche\nSarah Sabrei  - fausse couche\nLucy Sabrei - abandon du nourrisson ?\nDans le groupe des garçons, l\'examen andrologique a démontré des traces de viol également, antérieurement les testicules se sont développées normalement, sauf pour le jeune sujet Gorgy, le climat externe a limité son développement. Le rapport du Dr.Keller a affirmé que trois d\'entre eux ont été pères sur la route, ils avaient donc la capacité à se reproduire à l\'extérieur.\nJeremy Gorgy - stérile\nMark Lewis - reproducteur\nGary Wyatt Philips - reproducteur\nJono Uchi Sawari - développement normal\nBeau Lloyd - reproducteur\nJeffrey Jacob Abrahams - développement normal\n\nNous envisageons d\'aller cueillir des sujets directement aux portes, avant de leur faire passer le cocktail de vaccin, pour vérifier et étayer notre hypothèse, l\'installation d\'un clinique pré-poste de douanes serait un plus pour le projet. A soumettre à la direction.\n\n\n\nJ\'ai emmené les filles au parc, personnellement, pour comprendre leur histoire, je l\'ai ai écouté et les ai regardé se baigner. Elles ont l\'air heureuses ici et ont oubliés les tortures de l\'extérieur.\nPersonne ne sait que nous faisons mais nos recherches sont formelles, le dernier bastion de l\'humanité est un cercueil confortable. Il est impossible de procréer ici, le cocktail de vaccins des douanes combiné avec le passage d\'air de l\'extérieur semble produire un anticorps qui gèle les gamètes reproducteurs. Tout espoir d\'enfanter et de repeupler le dôme est vain. C\'est une catastrophe.\n\n\n\n\n', '', NULL, NULL),
