(35858, 1334, NULL, '0', 'Transit.inactifs', NULL, NULL, NULL, NULL, NULL, 1, NULL, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Une vieille photo tachée, une photo de groupe comme les vieilles photos de GI au Vietnam. Majoritairement des femmes et quelques hommes, bon nombre d\'entre eux portent des membres cybernétiques et ils semblent tous avoir traversé l\'enfer. A leurs pieds gisent des cadavres, la plupart ont l\'air difforme et très loin des standards humains. \n\n\nCertains vivants sont facilement identifiables, une jeune femme noire au crâne lisse, une androgyne albinos à moitié dénudée et couverte de sang le sourire aux lèvres, une cyber-roulure avec une lame cybernétique encore dégoulinante de sang. \n\nVous-même, entourée de plusieurs drones flottant dans les airs. Au milieu du groupe, on peut voir la doc en chef, que vous devinez plus que vous ne la reconnaissez... son visage est quasi intégralement couvert de bandages ensanglantés. L\'ambiance a l\'air joyeuse, typique des frères d\'armes après une bataille.\n\nAu dos de la photo, il y a une note manuscrite. Hiver 2048 Défense du Mur Extérieur.\nPlus bas votre écriture est plus nerveuse : Le début de la fin. Sauve-la, sauve-nous d’elle.\nSigné V. Langston\n', '[HJ: qui évolue en fonction des événements qui se déroulent dans le dôme avant l\'attaque des mutants sur la Faille. voir Eclipse.]', NULL, NULL),
